import React, {useState} from 'react';

import { booking } from '../../../settings';
import { StyledBookingInput, StyledBookingForm, StyledButton } from '../BookingEndpoint/Booking.styles';
import { MyBody } from '../BookingEndpoint/Booking.styles';

const BookingEndpoint = () => {


const handleSubmit = e =>{
    e.preventDefault();
    fetch(booking, requestOptions)
    .then(response => response.json())
    .then(data => console.log(data))
}

const requestOptions = {
    method: 'POST',
    body: JSON.stringify({}),
    headers: { 'Content-Type': 'application/json'}
    };

    

return (
    <MyBody>
        <StyledBookingForm id="dateduration">
            <StyledBookingInput type="date"
            placeholder="day/month/year"
            id="bookingDate">
            </StyledBookingInput>
            
            <StyledBookingInput
                type="number"
                placeholder="duration in minutes"
                id="duration"
            ></StyledBookingInput>
        

            <StyledButton type="submit" onSubmit={(handleSubmit)}>
            Confirm 
            </StyledButton>
        </StyledBookingForm>
    </MyBody>

    );
}
export default BookingEndpoint;
